[INSPECTION LOG #: 3526  ] PROCESS DESCRIPTION

THIS IS A READY MIX CONCRETE FACILITY.

NARRATIVE

I CARRIED OUT THE INSPECTION OF ADVANCED ON-SITE CONCRETE INCORPORATED, DUE TO CITIZEN COMPLAINT. IT WAS ALLEGED THAT SIGNIFICANT AMOUNT OF DUST ESCAPE OUT OF STORAGE SILOS, COVERS HIS CARS AND YARD. UPON ARRIVAL AT THE SITE I OBSERVED PLUME OF DUST FROM THE BAGHOUSE (DUST COLLECTION SYSTEM) ON TOP OF THE CEMENT SILO. I APPROACHED THE FACILITY AND SAW A CEMENT TRUCK CARRYING OUT UNLOADING ACTIVITIES OF CEMENT INTO THE SILOS (SEE PHOTO# 22). AS SOON AS HE SAW ME HE STOPPED UNLOADING OPERATIONS. I LATER MET THE PLANT MANAGER KEITH COLEMAN, WHO TOLD ME THE OWNER OF THE FACILITY WAS NOT AVAILABLE AT THIS TIME. HE CALLED HIM ON THE PHONE, AND THEY SPOKE TOGETHER. 

I ASKED TO BE TAKEN TO THE TOP OF THE SILOS IN ORDER TO INSPECT THE BAGS INSIDE THE BAGHOUSE. GEORGE, ONE OF THE STAFF CLIMBED WITH ME THE SILOS. THE SILO WAS VERY TALL (ABOUT 100FT ABOVE THE GROUND LEVEL). ITS HEIGHT MAKES AND ITS PROXIMITY TO THE FENCE LINES OF THE ADJACENT PROPERTIES, MAKE IT VERY EASY THE CEMENT PLUME RELEASED FROM THE BAGHOUSE TO MIGRATE OFF SITE (SEE PHOTO#S 14 AND 21). I TOLD THE PLANT MANAGER KEITH TO CONTINUE TO UNLOAD THE CEMENT INTO THE SILOS SO THAT HE CAN SEE THE PROBLEM THAT I OBSERVED WHILE ARRIVING AT THE SITE. HE REFUSED TO CONTINUE WHILE I WAS THERE. BELOW ARE MY OBSERVATIONS:

PARTICULATE MATERS AND FUGITIVE DUST EMISSIONS FROM CEMENT SILOS (SEE PHOTO#S1, 2, 3, 4 AND 5);

CEMENT ACCUMULATIONS ON THE TOP OF THE SILOS, FROM THE BAGHOUSE, WHICH COULD BE SEEN WASHED AWAY BY RAIN WATER (SEE PHOTO#S 6, 7, 12, AND 13);

EXCESSIVE CEMENT DUST COULD BE SEEN ALL OVER THE BAGS INSIDE THE BAGHOUSE, AN INDICATOR OF A IMPROPER INSTALLATION, OR FAULTY BAGS INSIDE THE BAGHOUSE (SEE PHOTO#S 8, 9, 10 AND 11);

ILLEGAL TRANSFER STATION, I OBSERVED DEMOLITION MATERIAL PILES IN DIFFERENT STORAGE AREAS (SEE PHOTO#S 16, 17, 18, 19, AND 20);

DUSTY AND DRY TRUCKING AREAS (SEE PHOTO#S 14, 21 AND 22), 

NO BUSINESS LICENSE FOR THIS PARTICULAR AND SPECIFIC SITE(1945 NORTH LATROBE), THERE IS A SECOND SITE ACROSS THE STREET LOCATED AT 5308 WEST GRAND, WHICH HAS A LIMITED BUSINESS LICENSE NUMBER 32886 CODE 1010 ACCOUNT NUMBER 32244 SITE 1 EXPIRED ON JANUARY 15, 2013. 

ADVANCED ON-SITE CONCRETE INCORPORATED WAS SERVED WITH NOTICE OF VIOLATION#S E000024792 17 AND E000024793 18 FOR THE MUNICIPAL CODES 11-4-760 (HANDLING OF MATERIAL SUSCEPTIBLE TO BECOMING WINDBORNE) 7-28-080 (NUISANCE IN CONNECTION WITH A BUSINESS ) AND 11-4-250 (WASTE HANDLING FACILITY ? PERMIT REQUIRED). HEARING DATE PENDING FOR JULY 12, 2012 AT 1:00 P.M. PLEASE SEE ALL THE ATTACHMENTS, FOLLOW UP INSPECTION IN THE MONTH OF JULY. 

SEE REPORTS ON GENERAL FOLLOW (ENVGEN120534) AND ENVCTY3744 INSPECTION# 447905
